import React from "react"
 const BoardElemt = (props)=>
 {
     if(props.el === 1){
        return (            
            <div className="playItem">X</div>
        )
     }else if(props.el === "0"){
        return (            
            <div className="playItem">0</div>
        )
     }else {
        return (            
            <div className="playItem"></div>
        )
     }
        
 }
 
 export default BoardElemt
